const getFacturePdf = async (req, res) =>{
    const queryGet =`SELECT 
    tempfacture.IdTempFacture, 
    tempfacture.IdFacture, 
    facture.DateFacture,
    clients.Sex,
    clients.Age,
    clients.NameFull,
    clients.Identify,
    clients.PhonePrimary,
    clients.Email,
    clients.Birhdate,
    clients.Address,
    facture.SubTotal,
    facture.SubTotal * 0.16 as Iva,
    facture.Total,
    services.CodService, 
    services.Description,
    tempfacture.Amount,
    services.Cost,
    services.Cost * tempfacture.Amount as Total
    from tempfacture join 
    clients on tempfacture.IdClient = clients.IdClients join
    services on tempfacture.IdServices = services.IdService join
    facture on tempfacture.IdFacture = facture.IdFacture`;
    try {
        const { IdClient,IdUser,IdFacture } = req.body;
        const connection = await getConnection();
        const result = await connection.query(`${queryGet} WHERE tempfacture.IdClient = '${IdClient}' and tempfacture.IdUser = '${IdUser}' and tempfacture.IdFacture = '${IdFacture}'`);

        try{
            if(result && result.length > 0){
                const stream = res.writeHead(200, {
                    "Content-Type": "application/pdf",
                    "Content-Disposition": "attachment; filename=assistencia.pdf"
                });
                buildPdf((data) => {
                    stream.write(data)
                }, 
                () => stream.end(),
                result,
                );
            }else{
                res.json({message: 'Ha ocurrido un error.', success: false})
            }
        }
        catch(err) {
            console.log(err);
        }

        }
    catch (err) {
        res.status(500)
        res.send(err.message)
    }
}

function parseDateString(inputString) {
    const date = new Date(inputString);
    const day = date.getDate();
    const month = date.getMonth() + 1;
    const year = date.getFullYear();
    const formattedDate = `${day}/${month}/${year}`;
    return formattedDate;
}

